import { Redirect } from "react-router-dom";

const PostGame = ({ token, win, userKills }) => {

    if (!token) {
        return <Redirect to='/' />
    }

    let results = 0

    if (win === true) {
        results = 1
    }

    return (
        <>
            {
                win?
                    <h3>
                        Congratulations you won!
                    </h3>
                :
                    <h3>
                        You got caught!
                    </h3>
            }

            <h3>
                You eliminated {userKills} players! 
            </h3>

            <p>
                Your account has been updated!
            </p>
        </>
    );
}

export default PostGame;
